; *******************************************************************************************/
fontArial32hb_glyph_ranges 

     ;charLow    nGlyphs     from      to
     ;=======    =======     =======   =======
     dw    20h,      60h    ;[0x0020 - 0x007F]   
     dw    a0h,      60h    ;[0x00A0 - 0x00FF]   


